from typing import List, Dict
from aiohttp import web

from openapi_server.models.item_snapshot_response import ItemSnapshotResponse
from openapi_server import util


async def get_item_snapshot_feed(request: web.Request, accept, x_ebay_c_marketplace_id, range, category_id, snapshot_date) -> web.Response:
    """get_item_snapshot_feed

     &lt;p&gt;The &lt;b&gt; Hourly Snapshot&lt;/b&gt; feed file is generated each hour every day for most categories. This method lets you download an &lt;b&gt; Hourly Snapshot&lt;/b&gt; TSV_GZIP (tab-separated value gzip) feed file containing the details of all the items that have &lt;a href&#x3D;\&quot;/api-docs/buy/static/api-feed.html#changed-items\&quot;&gt;changed&lt;/a&gt; &lt;i&gt; within&lt;/i&gt; the specified day and hour for a specific category.  This means to generate the 8AM file of items that have changed from 8AM and 8:59AM, the service starts at 9AM. You can retrieve the 8AM snapshot file at 10AM.&lt;/p&gt;    &lt;p&gt;Snapshot feeds now include new listings. You can check &lt;a href&#x3D;\&quot;/api-docs/buy/feed/resources/item_snapshot/methods/getItemSnapshotFeed#response.items.itemCreationDate\&quot;&gt;itemCreationDate&lt;/a&gt; to identify listings that were newly created within the specified hour.&lt;/p&gt;     &lt;p&gt;&lt;span class&#x3D;\&quot;tablenote\&quot;&gt;&lt;b&gt;Note: &lt;/b&gt;  Filters are applied to the feed files. For details, see &lt;a href&#x3D;\&quot;/api-docs/buy/static/api-feed.html#feed-filters\&quot;&gt;Feed File Filters&lt;/a&gt;.  When curating the items returned, be sure to code as if these filters are not applied as they can be changed or removed in the future.&lt;/span&gt;&lt;/p&gt;                  &lt;p&gt;You can use the response from this method to update the item details of items stored in your database. By looking at the value of &lt;a href&#x3D;\&quot;/api-docs/buy/feed/resources/item_snapshot/methods/getItemSnapshotFeed#response.items.itemSnapshotDate\&quot;&gt;itemSnapshotDate&lt;/a&gt; for a given item, you will be able to tell which information is the latest.&lt;/p&gt;   &lt;p&gt;&lt;span class&#x3D;\&quot;tablenote\&quot;&gt;&lt;span style&#x3D;\&quot;color:#FF0000\&quot;&gt; &lt;b&gt; Important:&lt;/b&gt; &lt;/span&gt; When the value of the &lt;b&gt; availability&lt;/b&gt; column is &lt;code&gt;UNAVAILABLE&lt;/code&gt;, only the &lt;b&gt;itemId&lt;/b&gt; and &lt;b&gt; availability&lt;/b&gt; columns are populated. &lt;/span&gt;&lt;/p&gt;&lt;h3&gt;&lt;b&gt;Downloading feed files &lt;/b&gt;&lt;/h3&gt;&lt;p&gt;Hourly snapshot feed files are binary gzip files. If the file is larger than 100 MB, the download must be streamed in chunks. You specify the size of the chunks in bytes using the &lt;a href&#x3D;\&quot;#range-header\&quot;&gt;Range&lt;/a&gt; request header. The &lt;a href&#x3D;\&quot;#content-range\&quot;&gt;Content-range&lt;/a&gt; response header indicates where in the full resource this partial chunk of data belongs and the total number of bytes in the file.       For more information about using these headers, see &lt;a href&#x3D;\&quot;/api-docs/buy/static/api-feed_beta.html#retrv-gzip\&quot;&gt;Retrieving a gzip feed file&lt;/a&gt;.  &lt;/p&gt;                                &lt;p&gt;&lt;span class&#x3D;\&quot;tablenote\&quot;&gt;  &lt;b&gt; Note:&lt;/b&gt; A successful call will always return a TSV.GZIP file; however, unsuccessful calls generate errors that are returned in JSON format. For documentation purposes, the successful call response is shown below as JSON fields so that the value returned in each column can be explained. The order of the response fields shows the order of the columns in the feed file.&lt;/span&gt;&lt;/p&gt;&lt;h3&gt;&lt;b&gt;Restrictions &lt;/b&gt;&lt;/h3&gt;&lt;p&gt;For a list of supported sites and other restrictions, see &lt;a href&#x3D;\&quot;/api-docs/buy/feed/overview.html#API\&quot;&gt;API Restrictions&lt;/a&gt;.&lt;/p&gt;  

    :param accept: The formats that the client accepts for the response.&lt;br&gt;&lt;br&gt;A successful call will always return a TSV.GZIP file; however, unsuccessful calls generate error codes that are returned in JSON format.&lt;br&gt;&lt;br&gt;&lt;b&gt;Default:&lt;/b&gt; &lt;code&gt;application/json,text/tab-separated-values&lt;/code&gt;
    :type accept: str
    :param x_ebay_c_marketplace_id: The ID of the eBay marketplace where the item is hosted. &lt;b&gt;Note: &lt;/b&gt; This value is case sensitive.&lt;br&gt;&lt;br&gt;For example: &lt;br&gt;&amp;nbsp;&amp;nbsp;&lt;code&gt;X-EBAY-C-MARKETPLACE-ID &#x3D; EBAY_US&lt;/code&gt;  &lt;br&gt;&lt;br&gt; For a list of supported sites see, &lt;a href&#x3D;\&quot;/api-docs/buy/feed/overview.html#API\&quot;&gt;API Restrictions&lt;/a&gt;.
    :type x_ebay_c_marketplace_id: str
    :param range: &lt;a name&#x3D;\&quot;range-header\&quot;&gt;&lt;/a&gt;This header specifies the range in bytes of the chunks of the gzip file being returned. &lt;br&gt;&lt;br&gt;&lt;b&gt; Format:&lt;/b&gt; &lt;code&gt;bytes&#x3D;&lt;em&gt;startpos&lt;/em&gt;-&lt;em&gt;endpos&lt;/em&gt;&lt;/code&gt;&lt;br&gt;&lt;br&gt;  For example, the following retrieves the first 10 MBs of the feed file. &lt;br&gt;&lt;br&gt;&amp;nbsp;&amp;nbsp;&lt;code&gt;Range bytes&#x3D;0-10485760&lt;/code&gt; &lt;br&gt;&lt;br&gt;For more information about using this header, see &lt;a href&#x3D;\&quot;/api-docs/buy/static/api-feed_beta.html#retrv-gzip\&quot;&gt;Retrieving a gzip feed file&lt;/a&gt;. &lt;br&gt;&lt;br&gt;&lt;b&gt;Maximum:&lt;/b&gt; 100 MB (10MB in the Sandbox)
    :type range: str
    :param category_id: An eBay top-level category ID  of the items to be returned in the feed file.&lt;br&gt; &lt;br&gt;The list of eBay category IDs changes over time and category IDs are not the same across all the eBay marketplaces. To get a list of the top-level categories for a marketplace, you can use the Taxonomy API &lt;a href&#x3D;\&quot;/api-docs/commerce/taxonomy/resources/category_tree/methods/getCategoryTree\&quot;&gt;getCategoryTree&lt;/a&gt; method. This method retrieves the complete category tree for the marketplace. The top-level categories are identified by the &lt;b&gt;categoryTreeNodeLevel&lt;/b&gt; field.&lt;br&gt;&lt;br&gt;&lt;b&gt;For example:&lt;/b&gt;&lt;br&gt;&amp;nbsp;&amp;nbsp;&lt;code&gt;\&quot;categoryTreeNodeLevel\&quot;: 1&lt;/code&gt; &lt;br&gt;&lt;br&gt;For details see &lt;a href&#x3D;\&quot;/api-docs/buy/buy-categories.html\&quot;&gt;Get Categories for Buy APIs&lt;/a&gt;.&lt;/li&gt;  &lt;/ul&gt; &lt;br&gt;&lt;br&gt;   &lt;b&gt;Restriction:&lt;/b&gt; Must be a top-level category other than Real Estate. Items listed under Real Estate L1 categories are excluded from all feeds in all marketplaces.
    :type category_id: str
    :param snapshot_date: The date and hour of the snapshot feed file you want. Each file contains the items that changed within the hour in the specified category. So, the 9AM file contains the items that changed between 9AM and 9:59AM on the day specified.  It takes 2 hours to generate a snapshot file, which means to get the file for 9AM the earliest you could submit the call is at 11AM.&lt;br&gt;&lt;br&gt;There are 7 days of &lt;b&gt; Hourly Snapshot&lt;/b&gt; feed files available.&lt;p&gt;&lt;span class&#x3D;\&quot;tablenote\&quot;&gt;&lt;b&gt;Note: &lt;/b&gt; The Feed API uses GMT, so you must convert your local time to GMT. For example, if you lived in California and wanted the September 15th 7pm file, you would submit the following call: &lt;br&gt; &lt;br&gt;&lt;code&gt;item_snapshot?category_id&#x3D;625&amp;snapshot_date&#x3D;2017-09-16T02:00:00.000Z&lt;/code&gt; &lt;/span&gt;&lt;/p&gt;  &lt;b&gt;Format: &lt;/b&gt;UTC &lt;code&gt;yyyy-MM-ddThh:00:00.000Z&lt;/code&gt; &lt;br&gt;&lt;br&gt;Files are generated on the hour, so minutes and seconds are &lt;em&gt; always&lt;/em&gt; zeros.
    :type snapshot_date: str

    """
    return web.Response(status=200)
